!function () {
    'use strict';
    //<editor-fold defaultstate="collapsed" desc="Angular App">
    var wishListApp = angular.module('wishListApp', ["ngRoute"]);
    
    //<editor-fold defaultstate="collapsed" desc="init Routing">
    wishListApp.config(function ($routeProvider) {
        $routeProvider
                .when("/", {
                    controller: "mainCtrl",
                    controllerAs: "vm",
                    templateUrl: "views/budget.html"
                })
                .when("/boughtItems", {
                    controller: "mainCtrl",
                    controllerAs: "vm",
                    templateUrl: "views/boughtItems.html"
                })
                .when("/wishList", {
                    controller: "mainCtrl",
                    controllerAs: "vm",
                    templateUrl: "views/wishList.html"
                });
    });
    //</editor-fold>
    
    //<editor-fold defaultstate="collapsed" desc="init Factory">
    wishListApp.factory('factory', function () {
        var img = "data:image/png;base64,";
        var img1 = "data:image/jpeg;base64,";
        var img2 ="data:image/png;base64,";
        var data = {
            budgetLimit: 1200,
            spentMoney: 0,
            wishes: [
                {
                    name : 'Xbox',
                    description : 'Xbox (stylized as XBOX) is a video gaming brand created and owned by Microsoft.',
                    image: img,
                    price : 350,
                    createDate :  (new Date()).getTime(),
                    status : 1,
                    purchasedDate : (new Date()).getTime(),
                    editDate : (new Date()).getTime()
                },
                {
                    name : 'PS4',
                    description : 'Playstation 4 es la nueva consola de sobremesa de SONY',
                    image: img1, 
                    price : 400,
                    createDate :  (new Date()).getTime(),
                    purchasedDate : (new Date()).getTime(),
                    status : 1
                },
                {
                    name : 'Vive Latino 2015',
                    description : 'Una entrada para el VL2014',
                    image: img2,
                    price : 40,
                    createDate :  (new Date()).getTime(),
                    status : 0
                }
                ,{
                    name : 'iPad ',
                    description : 'una ipda',
                    image: img,
                    price : 500,
                    createDate :  (new Date()).getTime(),
                    status : 0
                },
                {
                    name : 'tv 50"',
                    description : 'una pantalla de 50"',
                    image: img2,
                    price : 1100,
                    createDate :  (new Date()).getTime(),
                    status : 0
                }
            ]
        };
        var methods = {
            getBudgetLimit: function () {
                return data.budgetLimit;
            },
            setBudgetLimit: function (newLimit) {
                data.budgetLimit = parseInt(newLimit, 10);
                return this;
            },
            addWish: function (wish) {
                data.wishes.push(wish);
            },
            getWishes: function () {
                return data.wishes;
            },
            getSpentMoney : function () {
                return data.spentMoney;
            },
            validateCredit : function (money) {
                return data.budgetLimit-money>=0;
            },
            addToSpentMoney : function (money) {
                data.spentMoney+=parseInt(money,10);
                data.budgetLimit-=money;
                return this;
            }
        };
        return methods;
    });
    //</editor-fold>

    //<editor-fold defaultstate="collapsed" desc="create onReadFile directive">
    //this directive is a folk from  http://jsfiddle.net/alexsuch/6aG4x/
    wishListApp.directive('onReadFile', function ($parse) {
        return {
            restrict: 'A',
            scope: false,
            link: function (scope, element, attrs) {
                var fn = $parse(attrs.onReadFile);
                element.on('change', function (onChangeEvent) {
                    var reader = new FileReader();
                    reader.onload = function (onLoadEvent) {
                        scope.$apply(function () {
                            fn(scope, {
                                $fileContent: onLoadEvent.target.result
                            });
                        });
                    };
                    reader.readAsDataURL((onChangeEvent.srcElement || onChangeEvent.target).files[0]);
                });
            }
        };
    });
    //</editor-fold>

    //<editor-fold defaultstate="collapsed" desc="create timeago filtre">
    // thirdparty : http://jsfiddle.net/i_woody/cnL5T/
    wishListApp.filter('timeago', function() {
        return function(input, p_allowFuture) {                        
            var substitute = function (stringOrFunction, number, strings) {
                    var string = $.isFunction(stringOrFunction) ? stringOrFunction(number, dateDifference) : stringOrFunction;
                    var value = (strings.numbers && strings.numbers[number]) || number;
                    return string.replace(/%d/i, value);
                },
                nowTime = (new Date()).getTime(),
                date = (new Date(input)).getTime(),
                //refreshMillis= 6e4, //A minute
                allowFuture = p_allowFuture || false,
                strings= {
                    prefixAgo: null,
                    prefixFromNow: null,
                    suffixAgo: "ago",
                    suffixFromNow: "from now",
                    seconds: "less than a minute",
                    minute: "about a minute",
                    minutes: "%d minutes",
                    hour: "about an hour",
                    hours: "about %d hours",
                    day: "a day",
                    days: "%d days",
                    month: "about a month",
                    months: "%d months",
                    year: "about a year",
                    years: "%d years"
                },
                dateDifference = nowTime - date,
                words,
                seconds = Math.abs(dateDifference) / 1000,
                minutes = seconds / 60,
                hours = minutes / 60,
                days = hours / 24,
                years = days / 365,
                separator = strings.wordSeparator === undefined ?  " " : strings.wordSeparator,
            
                // var strings = this.settings.strings;
                prefix = strings.prefixAgo,
                suffix = strings.suffixAgo;
       
            if (allowFuture) {
                if (dateDifference < 0) {
                    prefix = strings.prefixFromNow;
                    suffix = strings.suffixFromNow;
                }
            }

            words = seconds < 45 && substitute(strings.seconds, Math.round(seconds), strings) ||
            seconds < 90 && substitute(strings.minute, 1, strings) ||
            minutes < 45 && substitute(strings.minutes, Math.round(minutes), strings) ||
            minutes < 90 && substitute(strings.hour, 1, strings) ||
            hours < 24 && substitute(strings.hours, Math.round(hours), strings) ||
            hours < 42 && substitute(strings.day, 1, strings) ||
            days < 30 && substitute(strings.days, Math.round(days), strings) ||
            days < 45 && substitute(strings.month, 1, strings) ||
            days < 365 && substitute(strings.months, Math.round(days / 30), strings) ||
            years < 1.5 && substitute(strings.year, 1, strings) ||
            substitute(strings.years, Math.round(years), strings);
            return $.trim([prefix, words, suffix].join(separator));
            // conditional based on optional argument
            // if (somethingElse) {
            //     out = out.toUpperCase();
            // }
            // return out;
        };
    });

    
    //</editor-fold>

    //</editor-fold>

    //<editor-fold defaultstate="collapsed" desc="Controller">
    var mainCtrl = wishListApp.controller('mainCtrl', function (factory) {
        this.formTitle = "New Wish";
        this.formMode = 1; //0 new wish, 1 edit wish
        this.editWish = null;
        this.budgetLimit = factory.getBudgetLimit();
        this.spentMoney = 0;
        this.newWishTemp = {
            name: '',
            description: '',
            image: '',
            price : 0
        };

        var $scope = this;
        $scope.file = 10;
        $scope.wishes = factory.getWishes();
        $scope.spentMoney = factory.getSpentMoney();
        this.setBudgetLimit = function () {
            factory.setBudgetLimit($scope.budgetLimit);
        };

        this.getFile = function () {
            console.log('bind', $scope.file);
        };

        this.showContent = function (img) {
            $scope.newWishTemp.image = img;
        };
        
        this.openImg = function (e) {
            window.open(e.target.src, '_blank');
        };
        var cleanWishTemp = function () {
            var wishTemp = $scope.newWishTemp;
            wishTemp.name = "";
            wishTemp.description = "";
            wishTemp.image = "";
            wishTemp.price = 0;
            $scope.formTitle = 'New Wish';
            $scope.editWish = null;
            $scope.formMode = 0;
        };
        this.addNewWish = function () {
            var wishTemp = $scope.newWishTemp;
            var newWish = {
                name : wishTemp.name,
                description : wishTemp.description,
                image: wishTemp.image,
                price : wishTemp.price,
                createDate :  (new Date()).getTime(),
                status : 0
            };            
            factory.addWish(newWish);  
            this.hideForm();
        };
        
        this.buy = function ($e ,wish) {
            var $div;
             if(factory.validateCredit(wish.price)){
                wish.status = 1;
                wish.purchasedDate = (new Date()).getTime();
                factory.addToSpentMoney(wish.price);
                $scope.budgetLimit = factory.getBudgetLimit();
                $scope.spentMoney = factory.getSpentMoney();
                $div = $('<div class="div-ok">The item was moved to the "My bought items" list</div>');
             }else{
                $div = $('<div class="div-error">Insufficient credit</div>')
             }
             showMsj($div);
        };
        
        var showMsj = function ($div) {
            $div.hide().appendTo("body")
                .slideDown('slow',function () {
                    setTimeout(function(){
                        $div.fadeOut('slow');
                    },2000);
                }).click(function(){
                    $div.fadeOut('slow');
                });
        };
        this.showWishForm = function () {
            cleanWishTemp();
            $scope.formTitle = 'New Wish';
            $wishForm.slideDown('slow');
        };
        this.hideForm = function () {
            $wishForm.hide('slow');
            cleanWishTemp();
        };
        this.edit = function ($e, wish) {
            var wishTemp = $scope.newWishTemp;
            this.showWishForm();
            $scope.formTitle = 'Edit Wish';
            $scope.editWish = wish;
            $scope.formMode = 1;
            wishTemp.name = wish.name;
            wishTemp.description = wish.description;
            wishTemp.image = wish.image;
            wishTemp.price = wish.price; 
            $('html,body').animate({ scrollTop: 0 }, 'slow');
        };
        this.updateWish = function () {
            var wishTemp = $scope.newWishTemp;
            var wish = $scope.editWish;
            wish.name = wishTemp.name;
            wish.description = wishTemp.description;
            wish.image = wishTemp.image;
            wish.price = wishTemp.price;
            wish.editDate = (new Date()).getTime();
            this.hideForm();
            var $div = $('<div class="div-update">the item was updated</div>');
            showMsj($div);
        };
        var $wishForm= $('.wishForm');

    });
    //</editor-fold>
}();

